import {CroctProvider, Personalization} from '@croct/plug-react'
function OnBoardingPage(props) {
  return (
    <Personalization expression="user's persona is not 'developer'">
                {(isDeveloper: boolean) => isDeveloper
                    ? <a href="/docs">View docs</a>
                    : <a href="/share">Share with your developer</a>
                }
            </Personalization>
  )
}
function App() {
  return (
    <CroctProvider appId="00000000-0000-0000-0000-000000000000"> 
    <div>
    <OnBoardingPage name="Mayara"/>
    </div>
    </CroctProvider>
  );
}

export default App;
